package com.baidu.web.vo.paypal;import com.fasterxml.jackson.annotation.JsonProperty;import lombok.Data;/** * @author xzll * @date 2021/10/8 20:20 * @description */@Datapublic class BillingCycles {    /**     * 定价方案     */    @JsonProperty(value = "pricing_scheme")    private PricingScheme pricingScheme;    /**     * 频率     */    private Frequency frequency;    /**     * 保有权类型 enum     * REGULAR 一个定期的计费周期     * TRIAL  试用计费周期     */    @JsonProperty("tenure_type")    private String tenureType;    /**     * 序列号     * 此周期在其他计费周期中运行的顺序。例如，试验计费周期的顺序是1，而常规计费周期的顺序是2，因此试验周期在常规周期之前运行。     */    private Integer sequence;    /**     * 总循环     * 这个计费周期执行的次数。试验计费周期只能执行有限次数(总周期值在1到999之间)。规则的计费周期可以执行无限次(总周期值为0)或有限次数(总周期值在1到999之间)。     */    @JsonProperty(value = "total_cycles")    private Integer totalCycles;}